import Link from 'next/link';



const Navbar = () => (
  <nav className= "navbar-dark bg-dark">
        <ul>
          <li className="nav-item">
            <Link href="/"><a >Ana Sayfa</a></Link>
          </li>
          <li className="nav-item">
            <Link href="/random"><a>Rastgele</a></Link>
          </li>
        </ul>

  </nav>
);

export default Navbar;
